import './App.css';
import './index.css';

import React from "react";


function Header() {
  return (
    <header className="cabecera container">
    <a className="logo"/>
    <img src="img/logo-universdad.png" width="200px" alt="Logo"></img>

    </header>
  );
}

export default Header;
